import React from 'react';
import { Sidebar, Menu, MenuItem } from 'react-pro-sidebar';
import { Link } from 'react-router-dom';
import { useProSidebar } from 'react-pro-sidebar';



const NavAdmin = () => {
  const { collapseSidebar, menuClasses } = useProSidebar();

  return (
    <div style={{ display: 'flex', height: '100%', minHeight: '750px' }}>
      <Sidebar transitionDuration={1000} backgroundColor="#434242">
        <Menu menuItemStyles={{
          button: ({ level, active, disabled }) => {
            // only apply styles on first level elements of the tree
            if (level === 0)
              return {
                color: disabled ? '#ffffff' : '#ffffff',
              };
          },
        }}>
          <MenuItem routerLink={<Link to="/documentation" />}> Dashboard</MenuItem>
          <MenuItem routerLink={<Link to="/calendar" />}> Tabel Kegiatan</MenuItem>
          <MenuItem routerLink={<Link to="/e-commerce" />}> E-commerce</MenuItem>
        </Menu>
      </Sidebar>
      {/* <main style={{ padding: 10 }}>
        <div>
          <button className="sb-button" onClick={() => collapseSidebar()}>
            Collapse
          </button>
        </div>
      </main> */}
    </div>
  )
};

export default NavAdmin;
